import os
import boto3
from botocore.config import Config
from dotenv import load_dotenv
import base64
from io import BytesIO
import mimetypes

# Load environment variables from .env file
load_dotenv()

# Get environment variables with fallback values
DO_SPACES_KEY = os.getenv('DO_SPACES_KEY', 'default_key')
DO_SPACES_SECRET = os.getenv('DO_SPACES_SECRET', 'default_secret')
DO_SPACES_NAME = os.getenv('DO_SPACES_NAME', 'default_bucket_name')
DO_SPACES_REGION = 'blr1'  # Update your region if different
DO_SPACES_ENDPOINT = f"https://{DO_SPACES_REGION}.digitaloceanspaces.com"

# Print environment variables to verify
print(f"DO_SPACES_KEY: {DO_SPACES_KEY}")
print(f"DO_SPACES_SECRET: {DO_SPACES_SECRET}")
print(f"DO_SPACES_NAME: {DO_SPACES_NAME}")
print(f"DO_SPACES_ENDPOINT: {DO_SPACES_ENDPOINT}")

# Ensure all variables are properly set
if not all([DO_SPACES_KEY, DO_SPACES_SECRET, DO_SPACES_NAME, DO_SPACES_ENDPOINT]):
    raise ValueError("One or more environment variables are not set correctly.")

# Configure boto3 to use DigitalOcean Spaces
session = boto3.session.Session()
client = session.client('s3',
                        region_name=DO_SPACES_REGION,
                        endpoint_url=DO_SPACES_ENDPOINT,
                        aws_access_key_id=DO_SPACES_KEY,
                        aws_secret_access_key=DO_SPACES_SECRET)

print('client', client)

# Function to list all files and folders in a bucket
def list_files(bucket_name):
    print('bucket name', bucket_name)
    try:
        response = client.list_objects_v2(Bucket=bucket_name)
        print('response', response)
        if 'Contents' in response:
            for obj in response['Contents']:
                object_key = obj['Key']
                # Generate a presigned URL for the object
                url = client.generate_presigned_url(
                    'get_object',
                    Params={'Bucket': bucket_name, 'Key': object_key},
                    ExpiresIn=3600  # URL expires in 1 hour (3600 seconds)
                )
                print(f"Public URL for {object_key}: {url}")
        else:
            print("No objects found in the bucket.")
    except Exception as e:
        print(f"Error listing files: {e}")

# Function to upload a file from Base64 representation to DigitalOcean Space
def upload_file_from_base64(bucket_name, base64_data, file_name):
    try:
        # Decode Base64 data
        image_data = base64.b64decode(base64_data)
        
        # Determine content type dynamically
        content_type = mimetypes.guess_type(file_name)[0] or 'application/octet-stream'
        
        # Upload the file to DigitalOcean Space
        response = client.put_object(
            Bucket=bucket_name,
            Key=file_name,
            Body=image_data,
            ContentType=content_type
        )
        
        print(f"Successfully uploaded {file_name} to {bucket_name}")
    except Exception as e:
        print(f"Error uploading file: {e}")

# Call the function with your bucket name
list_files(DO_SPACES_NAME)

